import React, { useState, useEffect } from 'react';
import { AppBar, Toolbar, Typography, IconButton, Menu, MenuItem } from '@mui/material';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import SettingsIcon from '@mui/icons-material/Settings';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import AddIcon from '@mui/icons-material/Add';
import logo from '../assets/LogoAutoWhappBlanco.png';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

interface Negocio {
  id: number;
  nombre: string;
}

const Header: React.FC<{ onNegocioChange: (negocioId: number) => void }> = ({ onNegocioChange }) => {
  const [negocios, setNegocios] = useState<Negocio[]>([]);
  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);
  const [selectedNegocioId, setSelectedNegocioId] = useState<number | null>(null);
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get<Negocio[]>('http://localhost:3000/api/negocios')
      .then(response => {
        const negociosRes = Array.isArray(response.data) ? response.data : [];
        setNegocios(negociosRes);
        setError(null);
        if (negociosRes.length > 0) {
          const firstNegocioId = negociosRes[0].id;
          setSelectedNegocioId(firstNegocioId); // Establecer el negocio seleccionado inicialmente
          onNegocioChange(firstNegocioId); // Llamar al callback para el padre
        }
      })
      .catch(error => {
        console.error('Error al obtener los negocios:', error);
        setNegocios([]);
        setError('No se pudieron cargar negocios');
      });
  }, [onNegocioChange]);

  const handleMenuOpen = (event: React.MouseEvent<HTMLElement>) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleNegocioSelect = (negocioId: number) => {
    setSelectedNegocioId(negocioId); // Actualizar el negocio seleccionado
    onNegocioChange(negocioId); // Notificar al padre del cambio
    handleMenuClose();
  };

  const handleAddBusiness = () => {
    handleMenuClose();
    navigate('/add-business');
  };

  // Mostrar el nombre del negocio seleccionado en el menÃº (opcional, para feedback visual)
  const selectedNegocio = negocios.find(negocio => negocio.id === selectedNegocioId);

  return (
    <AppBar
      position="sticky"
      sx={{
        background: 'linear-gradient(90deg, rgb(69, 79, 255) 17%, rgb(255, 255, 255) 28%)',
        boxShadow:
          '0 6px 24px -8px rgba(50,60,130,0.5), 0 5px 3px 0 rgba(30,40,90,0.5)',
        zIndex: 1300,
      }}
    >
      <Toolbar>
        <img
          src={logo}
          alt="Logo AutoWhapp"
          style={{
            height: 40,
            width: 40,
            marginRight: 16,
            objectFit: 'contain',
          }}
        />
        <Typography
          variant="h6"
          sx={{
            flexGrow: 1,
            fontFamily: 'Poppins',
            fontWeight: 'bold',
          }}
        >
          AutoWhapp
        </Typography>
        <IconButton
          sx={{
            backgroundColor: 'rgb(69, 79, 225)',
            marginRight: 1,
            '&:hover': { backgroundColor: '#93C5FD' },
          }}
        >
          <HelpOutlineIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
        <IconButton
          sx={{
            backgroundColor: 'rgb(69, 79, 225)',
            marginRight: 1,
            '&:hover': { backgroundColor: '#93C5FD' },
          }}
        >
          <SettingsIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
        <IconButton
          sx={{
            backgroundColor: 'rgb(69, 79, 225)',
            '&:hover': { backgroundColor: '#93C5FD' },
          }}
          onClick={handleMenuOpen}
        >
          <PersonOutlineIcon sx={{ color: '#FFFFFF' }} />
        </IconButton>
        <Menu
          anchorEl={anchorEl}
          open={Boolean(anchorEl)}
          onClose={handleMenuClose}
          PaperProps={{
            sx: {
              backgroundColor: 'rgb(69, 79, 225)',
              color: '#FFFFFF',
            },
          }}
        >
          {error ? (
            <MenuItem disabled>{error}</MenuItem>
          ) : Array.isArray(negocios) && negocios.length > 0 ? (
            negocios.map(negocio => (
              <MenuItem
                key={negocio.id}
                onClick={() => handleNegocioSelect(negocio.id)}
                sx={{
                  fontFamily: 'Poppins',
                  '&:hover': { backgroundColor: '#93C5FD' },
                  backgroundColor: selectedNegocioId === negocio.id ? '#93C5FD' : 'transparent', // Resaltar el negocio seleccionado
                }}
              >
                {negocio.nombre}
              </MenuItem>
            ))
          ) : (
            <MenuItem disabled>Sin negocios disponibles</MenuItem>
          )}
          <MenuItem
            onClick={handleAddBusiness}
            sx={{
              fontFamily: 'Poppins',
              '&:hover': { backgroundColor: '#93C5FD' },
            }}
          >
            <AddIcon sx={{ mr: 1 }} />
            Agregar Negocio
          </MenuItem>
        </Menu>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
